window.bookSummaryJSON = "<p>Every disaster brings an opportunity.</p> <p>Goth Sullus and his empire have fallen.&nbsp;&nbsp;</p> <p>With the Legion and the rest of the galaxy watching from the still-smoldering galactic core, Carter, a former legionnaire turned private contractor, and Jack Bowie, a Navy spy with nowhere left to turn, sign up to work for an enterprising private contractor looking to make a statement on the planet Kublar.</p> <p>Plans are in motion dating back to the Savage Wars, and as the galaxy rushes to fill in the vacuum created by the fall of the Imperial Republic, the bodies are hitting the floor.&nbsp;&nbsp;</p> <p>But every plan has a reckoning…</p> <p><i>Takeover</i> is the thrilling aftermath of the final, desperate execution of Article Nineteen and the looming rebirth of the Legion and the galaxy itself as Galaxy’s Edge: Season Two begins!</p>"; 
